import "bootstrap/dist/css/bootstrap.css";
import "./messagestyle.css";
import React from "react";

import { useContext } from "react";
import { SocketContext } from '../SocketContext';

import moment from "moment";

import { Button, TextField, Grid, Typography, Container, Paper } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';
const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    flexDirection: 'column',
  },
  gridContainer: {
    width: '100%',
    [theme.breakpoints.down('xs')]: {
      flexDirection: 'column',
    },
  },
  container: {
    width: '600px',
    margin: '10px 0',
    padding: 0,
    [theme.breakpoints.down('xs')]: {
      width: '80%',
    },
  },
  margin: {
    marginTop: 20,
  },
  padding: {
    padding: 20,
  },
  paper: {
    padding: '10px 50px',
    border: '5px solid black',
  },
}));



const Message =({children}) =>{
    const {users,message,messages,submit,setMessage,username,user} =useContext(SocketContext);
    const classes = useStyles();
    return(/*
<div className="container" >
    <div className="row">
      <div className="col-md-12 mt-4 mb-4" >
        <h6>{username}</h6>
      </div>
    </div>
    <div className="row">
      <div className="col-md-8" >
        <h6>Messages</h6>
        <div id="messages" >
          {messages.map(({ user, date, text }, index) => (
            <div key={index} className="row mb-2">
              <div className="col-md-3" >
                <h5>{moment(date).format("h:mm:ss a")}</h5>
              </div>
              <div className="col-md-2"><h5>{user.name}</h5></div>
              <div className="col-md-2">{text}</div>
            </div>
          ))}
        </div>
        <form onSubmit={submit} id="form">
          <div className="input-group">
            <input
              type="text"
              className="form-control"
              onChange={e => setMessage(e.currentTarget.value)}
              value={message}
              id="text"
            />
            <span className="input-group-btn">
              <button id="submit" type="submit" className="btn btn-primary">
                Send
              </button>
            </span>
          </div>
        </form>
      </div>
      <div className="col-md-4">
        <h6>Users</h6>
        <ul id="users">
          {users.map(({ name, id }) => (
            <li key={id}>{name}</li>
          ))}
        </ul>
      </div>
    </div>
  </div>*/
  <Container className={classes.container}>
                             <Paper>
                              <div align="left" className="col-md-4" >
                                <h6>Users</h6>
                                <ul id="users">
                                  {users.map(({ name, id }) => (
                                    <li key={id}>{name}</li>
                                  ))}
                                </ul>
                              </div>
                              </Paper>
            <Paper elevation={10} className={classes.paper}>
                <form className={classes.root} noValidate autoComplete="off">
                    <Grid container className={classes.gridContainer}>
                        <Grid item xs={12} md={6} className={classes.padding}></Grid>
                        <Typography gutterBottom variant="h4" >Messenger</Typography>
                        <div id="messages" >
                            {messages.map(({ user, date, text }, index) => (
                              <div key={index} className="row mb-2">
                                <div className="col-md-3" >
                                  <h7>{moment(date).format("h:mm:ss a")}</h7>
                                </div>
                                <div className="col-md-2"><h7><b>{user.name}</b></h7></div>
                                <div className="col-md-2">{text}</div>
                              </div>
                            ))}
                          </div>
                          <form onSubmit={submit} id="form">
                              <div className="input-group">
                                <input
                                  type="text"
                                  className="form-control" 
                                  onChange={e => setMessage(e.currentTarget.value)}
                                  value={message}
                                  id="text"
                                />
                                <span className="input-group-btn">
                                <Button variant="contained" color="secondary" id="submit" type="submit"  onClick={submit} className={classes.margin}>
                                
                                    Send
                                  </Button>
                                </span>
                              </div>
                            </form>
                            </Grid>
                      </form>
                      </Paper>
                      
                      </Container>

    )
}

export default Message
